	               level.player.scripted_move_to_x(midpoint_x - 200, 1, fire_event(me, 'do_dialog')),
	               level.player.scripted_move_to_x(midpoint_x + 200, -1, fire_event(me, 'do_dialog')))
				)
			 ]"
	on_do_dialog="[
	         speech_dialog(me, title('Victory!'),
				    				music('FrogattoTitle.ogg'),
			  				  fire_event('beaten_up_mutter'),
	         					[~Ugh!~,~You do put up quite a fight!~],
					       	 set(level.player.animation, 'emote_geez'),
			     level.player, [~Will you hear me out now?~],
			  				  fire_event('beaten_up_mutter'),
			               me, [~Yes.~],
			  				  fire_event('beaten_up_mutter'),
						       [~What was it you wanted?~],
			  				  fire_event('get_up'),
					       	 set(level.player.animation, 'emote_geez'),
			     level.player, [~I want you to call your goons off!~,
			     				~Stop harassing the town folk and all!~],
			  				  animation('emote_assertive'),
			               me, [~The town folk?~],
			  				  animation('emote_pensive'),
			               		[~*That's* what this is all about?~,
						        ~Well, perhaps we could talk it over?~],
							 set(level.player.animation, 'emote_confused'),
			     level.player, [~Talk it over? Like gentlemen?~],
			  				  animation('emote_talk'),
				           me, [~Yes, like gentlemen. Over tea.~]),
			 teleport('tea-with-milgram.cfg','', 'iris')]"
	on_end_crush_anim="spawn('milgram_block', level.player.midpoint_x, 600, facing)"
	on_talk_frogatto="[remove_object(get_object(level, 'guard')),
	                   set(animation, 'stand'),
	                   set(level.focus, [milgram, level.player]),
					       				 set(me.animation, 'emote_talk'),
	                   speech_dialog(me, [~Wait a minute, it's you, isn't it?~],
					       				 set(level.player.animation, 'emote_nod'),
					       level.player, [~Yup, I'm Frogatto!~],
					       				 set(me.animation, 'emote_pensive'),
								     me, [~Uhh..~],
					       				 set(me.animation, 'emote_talk'),
								     	 [~I was expecting something a bit more ...~],
					       				 set(level.player.animation, 'emote_talk'),
					       level.player, [~Threatening?~, ~I can do threatening!~],
					       				 set(level.player.animation, 'emote_raisedfinger'),
					       				 [~I'm here to teach you a lesson!~],
										 set(me.animation,'emote_laugh'),
								     me, [~HAHAHA!~,
									      ~Why, I like you already, little frog.~,
										  ~You're quite a laugh.~],
					       				 set(level.player.animation, 'emote_geez'),
					       level.player, [~Hey, I'm serious, here!~,~Will you hear me out?~],
					       				 set(me.animation, 'emote_talk'),
					       			 me, [~Nope.~],
					       				 set(me.animation, 'emote_assertive'),
					       			 [~Either you get off my property,~,~or I clean your clock.~],
					       				 set(level.player.animation, 'emote_impatient'),
					       				 set_solid(217, 0, 223, 1150, 1),
					       				 fire_event(get_object(level,'gate'),'lock'),
						 level.player, [~Fine.~],
						 music('MilgramBossBattle.ogg'),
						 title('Fight!')),
	                   set(level.focus, []), set(level.zoom, 1),
	                   set(vars.passive, 0),
	                   set(solid_dimensions_in, ['boss']),
	                   set(collide_dimensions_in, ['boss']),
					   set(level.player.control_lock, null()),
					   set(level.gui.vars.bosses, [me]),
					   end_skip_dialog_sequence()
					   ]"
